import React from "react";
import "social-share-button";
import { AiOutlineFacebook, AiOutlineTwitter } from "react-icons/ai";
import { Link } from "react-router-dom";

import "./Menu.css";

import MenuBar from "./Menubar/MenuBar";
import MenuInput from "./MenuInput";
import Drawer from "./Drawer/Drawer";

export default function Menu(props) {
  return (
    <div className="menu-area">
      <MenuBar />
      <div key={1} className="menu-input">
        <Link className="social-media"
          data-module="SocialShareButton"
          data-module-text="Divulgue Jogos Indie"
          data-module-title="Jogos indie"
          data-module-base-url="https://www.jogosindie.com.br/"
          data-module-net="facebook"
        >
          <AiOutlineFacebook size="2.8em" />
        </Link>
        <Link className="social-media"
          data-module="SocialShareButton"
          data-module-text="Divulgue Jogos Indie"
          data-module-title="Jogos indie"
          data-module-base-url="https://www.jogosindie.com.br/"
          data-module-net="facebook"
        >
          <AiOutlineTwitter size="2.8em" />
        </Link>
        <MenuInput />
      </div>
      <Drawer />
    </div>
  );
}
